import { BrowserRouter, Switch, Route } from "react-router-dom";
import  Home  from "./pages/Home";


function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" Component={Home} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
